import './assets/css/App.css';


import { BrowserRouter, Switch , Routes, Route} from 'react-router-dom';
import Login from './components/login';

import ShowProducto from './components/ShowProducto';
import React from 'react';
// import login

// import{}from

function App() {
  return (
    <div className="App">
      <React.Fragment>
      <BrowserRouter>
        <Routes>
          <Route path='/'  exact>
            <Login/>
          </Route>
        </Routes>
      </BrowserRouter>
      </React.Fragment>
      <BrowserRouter>
        <Routes>
          <Route path='/catalogo'  element={<ShowProducto/> } />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
